// MainHome.js
import React from "react";
import { Link } from "react-router-dom";

function MainHome() {
    return (
        <div>
            <h1>Main Home</h1>
            <ul>
                <li><Link to="/">Mainhome</Link></li>
                <li><Link to="/list">Post List View (Alternative)</Link></li>
                <li><Link to="/helloworld">Hello World</Link></li>
                <li><Link to="/signup">Sign Up</Link></li>
                <li><Link to="/create">Create New Post</Link></li>
                {/* Note: 이 링크는 특정 게시물의 ID에 따라 동작하므로 예시 링크로 추가했습니다. */}
                <li><Link to="/post/1">Post Detail View (Example for ID: 1)</Link></li>
                <li><Link to="/post/1/edit">Edit Post (Example for ID: 1)</Link></li>
            </ul>
        </div>
    );
}

export default MainHome;
